import React from 'react';

function Home() {
  return (
    <div className="home-page">
      <h1>Welcome to Our Social Network</h1>
      <p>Get started by browsing posts or logging in</p>
      <div className="home-links">
        <a href="/feed">View Feed</a>
      </div>
    </div>
  );
}

export default Home;
